        body {
            font-family: Arial, Helvetica, sans-serif
        }

        .container {
            align-items: center;
            display: flex;
            flex-direction: column;
            height: 100%;
            justify-content: center;
            width: 100%
        }

        @keyframes enlarge-appear {
            0% {
                opacity: 0;
                transform: scale(75%)
            }
            to {
                opacity: 1;
                transform: scale(100%)
            }
        }

        .logo {
            color: #8e8ea0;
            padding-bottom: 1.5rem
        }

        .scale-appear {
            border-radius: 18px;
            animation: enlarge-appear .5s ease-in
        }

        @media (min-width: 768px) {
            .scale-appear {
                height: 96px;
                width: 96px
            }
        }

        .data:empty {
            display: none
        }

        .data {
            border-radius: 5px;
            color: #8e8ea0;
            max-width: 420px;
            text-align: center;
            width: 100%
        }

        .data ul {
            list-style: none;
            padding: 0
        }

        .blocked-icon {
            color: #ef4444
        }

        .message {
            align-items: center;
            display: flex;
            font-size: 1.5rem;
            gap: 1rem;
            justify-content: center
        }

        .explanation {
            font-size: .9rem;
            line-height: 1.5;
            max-width: 420px;
            opacity: 50%;
            text-align: center;
            width: 100%
        }

        .explanation a {
            color: #000
        }

        @media (prefers-color-scheme: dark) {
            body {
                background-color: #2d303e;
                color: #eee
            }

            .logo {
                color: #acacbe
            }

            .explanation a {
                color: #fff
            }
        }
    </style>
